export default function EndQuiz() {
    return (
        <section className="completion">
            <h2>Thank you for completing the Quiz!</h2>
            <span className="emoji">üëç - You did well</span>
            <p className="result">You scored <strong>20</strong> out of 70, and your percentage is <strong>28.57%</strong></p>
            <p className="highscore">(HighScore: 65 points)</p>
            <button className="restart">Restart quiz</button>
        </section>
    );
}
